import React, { useState, useEffect} from 'react'
import Json from '../../json/productos.json'

const products = [
    {"nombre":"boca"}
]

const Cards = () => {

    const [cardsProducts, setCardsProducts] = useState([])
    
    useEffect(() => {
        fetch(products)
        .then(response => {
            if (!response.ok) {
                throw new Error('Network response was not ok');
            }
            return response.json();
        })
        .then(dataJson => setCardsProducts(dataJson.results))
        .catch(error => console.log('Error fetching data: ', error));
    }, []);
console.log (cardsProducts)
    return (
    <div>
        {
            cardsProducts.map(product => (
                <li style={{ backgroundColor: '#FFF', padding: '10px', margin: '10px 0', borderRadius: '5px', boxShadow: '0px 3px 3px rgba(0,0,0,0.1)'}}>{product.nombre}</li>
            ))
        }
    </div>
    )
}

export default Cards
